import React, { useContext } from 'react';
import { ColorSchemeContext } from '../ColorSchemeContext';

const AboutPage = () => {
  const { colorScheme } = useContext(ColorSchemeContext);

  const {
    backgroundColor,
    primaryColor,
    secondaryColor,
    fontSize,
    fontColor,
  } = colorScheme;

  return (
    <div
      style={{
        backgroundColor: backgroundColor,
        color: fontColor,
      }}
    >
      <header className="header" style={{ backgroundColor: primaryColor }}>
        Header
      </header>
      <main style={{ backgroundColor: secondaryColor, fontSize: fontSize }}>
        <h1>About Page</h1>
        <p>Content goes here</p>
      </main>
      <footer className="footer" style={{ backgroundColor: primaryColor }}>
        Footer
      </footer>
    </div>
  );
};

export default AboutPage;
